import React from "react";
import MachineCard from "../components/Cards/Machine/MachineCard";

function MachinesPage() {
  const machines = [
    {
      diskread: 0,
      netout: 0,
      disk: 0,
      cpu: 0,
      maxmem: 2147483648,
      maxdisk: 34359738368,
      vmid: 102,
      cpus: 2,
      mem: 0,
      status: "stopped",
      name: "ubuntu-live-server-vm",
      uptime: 0,
      netin: 0,
      diskwrite: 0,
    },
    {
      diskread: 0,
      netout: 0,
      disk: 0,
      cpu: 0,
      maxmem: 2147483648,
      maxdisk: 34359738368,
      vmid: 102,
      cpus: 2,
      mem: 0,
      status: "running",
      name: "ubuntu-live-server-vm2",
      uptime: 0,
      netin: 0,
      diskwrite: 0,
    },
  ];

  return (
    <div>
      <span>Your Machines</span>
      <div className="Machines">
        {machines.map((machine) => (
          <MachineCard
            key={machine.vmid}
            machineData={machine}
          />
        ))}
      </div>
    </div>
  );
}

export default MachinesPage;
